import React from "react";
import {BsHouse} from "react-icons/bs";
import {AiOutlineTeam, AiOutlineFolderOpen, AiOutlineFile, AiOutlineLogout} from "react-icons/ai"
import {FaRegUserCircle} from "react-icons/fa"
import {logoutUser} from "../../Redux/APIRequest/apiAuthRequest";
import {useDispatch, useSelector} from "react-redux";
import {Link, useNavigate} from "react-router-dom";
import {createAxios} from "../../createInstance";
import {logoutSuccess} from "../../Redux/Slice/authSlice";


function Nav() {
    const dispatch = useDispatch();
    const navigate = useNavigate();
    const token = useSelector(state => state.auth.login.token);
    const refreshToken = token?.refreshToken;
    const accessToken = token?.accessToken;
    const user = useSelector(state => state.auth.login.currentUser);
    const axiosJWT = createAxios(user, accessToken, refreshToken, dispatch, logoutSuccess);

    function handleLogOut() {
        logoutUser(dispatch, navigate, accessToken, axiosJWT);
    }

    return (
        <>
            <nav className="h-screen flex items-center fixed flex-col border-r border-r-slate-300 justify-between z-50">
                <div className="w-auto">
                    <div>
                        <img src="data:image/png;base64," alt="anh icon" className="w-12 h-12 object-cover cursor-pointer"/>
                    </div>
                    <Link to={"/"} className="text-2xl py-3 cursor-pointer rounded hover:bg-gray-400 flex justify-center">
                        <BsHouse/>
                    </Link>
                    <Link to={"/"} className="text-2xl py-3 cursor-pointer rounded hover:bg-gray-400 flex justify-center">
                        <AiOutlineTeam/>
                    </Link>
                    <Link to={"/"} className="text-2xl py-3 cursor-pointer rounded hover:bg-gray-400 flex justify-center">
                        <AiOutlineFolderOpen/>
                    </Link>
                    <Link to={"/blog/add"} className="text-2xl py-3 cursor-pointer rounded hover:bg-gray-400 flex justify-center">
                        <AiOutlineFile/>
                    </Link>
                </div>

                <div className="w-12">
                    <Link to={"/profile"} className="text-2xl py-3 cursor-pointer rounded hover:bg-gray-400 flex justify-center">
                        <FaRegUserCircle/>
                    </Link>
                    <div className="text-2xl py-3 cursor-pointer rounded hover:bg-gray-400 text-red-600 flex justify-center"
                         onClick={handleLogOut}>
                        <AiOutlineLogout/>
                    </div>
                </div>
            </nav>
        </>
    )
}

export default Nav;
